import React from 'react';

class TopBar extends React.Component {
    render() {
        return (

            <div>
                <nav>
                    <a href="google.com" classname="brand-logo"><drawer /></a>
                    <div classname="nav-wrapper container">
                        <ul classname="left">
                            <li><a href="sass.html">All Categories</a></li>
                            <li><i classname="material-icons prefix">arrow_drop_down</i></li>
                            <li><a href="badges.html">All Times</a></li>
                            <li><i classname="material-icons prefix">arrow_drop_down</i></li>
                            <li><i classname="material-icons prefix" htmlfor="icon_search" 
                            style={{paddingleft: "3rem"}}>search</i></li>
                            <li><input id="icon_search" type="text" classname="validate" /></li>
                        </ul>
                        <ul id="nav-mobile" classname="right hide-on-med-and-down">
                            <li><a href="google.com" classname="brand-logo">Library </a></li>
                        </ul>
                    </div>
                </nav>

            </div>
        );
    }
}

export default TopBar;
